  false,\n\t\"url\": null,\n\t\"notes\": \"The majority of the seabirds on the refuge
  use Puffin Island. Table 2 indicates the species composition and number of seabirds
  censused on 13 August from 1200 - 1400, and our best estimate of the seabird population.
  In addition to the census, we made 5 counts of murres at Puffin Island to determine
  species composition. The counts revealed that Common and Thick-billed murres were
  in a ratio of 2.9:1. This figure was used to determine total number of each murre
  species. The most striking feature of Puffin Island is the number of Horned Puffins
  nesting in burrows. We found that 70% of the puffins that we counted were sitting
  in a soil habitat. In the plots we established on Puffin Island, we found 19, 29,
  and 23 burrows (X= 23.6) or .94 burrows/square meter for the three plots. By creating
  such a dense matrix of burrows, the Horned Puffins may be radically altering the
  habitat on Puffin Island. A comparison of photographs taken in 1968 and 1977 (Appendix
  I) show that a considerable loss of vegetation has occurred with subsequent erosion.
  The digging of the puffins may only hasten the erosion.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
